def token(testName, url, data='null', action='POST'):
    try:
        headers = {'Content-type': 'application/json'}
        sleep(15)
        r = requests.post(url, json.dumps(data), headers=headers,verify=False)
        if(r.status_code != 200):
            print(r.text)
            print('verifyOtpResult','400')
            return ''    
        jsondata = r.json()
        global tokens
        global userid 
        global petId
        tokens=jsondata["data"]['token']
        userdata = jsondata["data"]['user']
        userdata = ast.literal_eval(userdata)
        userid= userdata['id']
        petId = userdata['selected_pet']
        return '200'
    except Exception as exc:
            print('%r generated an exception: %s for: %s' % (url, exc,sys.argv[1]))
            exit()

def base_call(testName, url, data='null', action='POST'):
    try:
        if(testName != "loginUrl"):
            headers = {'Authorization': 'Bearer '+str(tokens),'Content-type': 'application/json'}
        else:
            headers = {'Content-type': 'application/json'}
        sleep(15)
        if action == "GET":
            r = requests.get(url, headers=headers,verify=False)
        else:
            r = requests.post(url, json.dumps(data), headers=headers,verify=False)
        print(testName,'call for Mobile No',sys.argv[1])
        if(r.status_code != 200 and r.status_code != 201):
            # print(r.text)
            if hasattr(r,'message'):
                print('Error',r.message,sys.argv[1])
                exit()
            else:
                print('error',sys.argv[1])
        
        return r.status_code
    except Exception as exc:
        print('%r generated an exception: %s for: %s' % (url, exc,sys.argv[1]))
        exit()


